// src/components/Navbar.js
import React from 'react';

const Navbar = () => {
  return (
    <div style={styles.navbar}>
      <h3 style={styles.title}>Categories</h3>
      <a href="#category1" style={styles.link}>Category 1</a>
      <a href="#category2" style={styles.link}>Category 2</a>
      <a href="#category3" style={styles.link}>Category 3</a>
      <a href="#category4" style={styles.link}>Category 4</a>
      <a href="#category5" style={styles.link}>Category 5</a>
    </div>
  );
};

const styles = {
  navbar: {
    width: '200px',
    padding: '20px',
    borderLeft: '1px solid #ccc',
    height: '100vh',
    position: 'fixed',
    right: 0,
    top: 0,
  },
  title: {
    marginBottom: '10px',
    fontSize: '1.2rem',
    fontWeight: 'bold',
  },
  link: {
    display: 'block',
    marginBottom: '10px',
    color: '#333',
    textDecoration: 'none',
  },
};

export default Navbar;
